      }
    };
*/


    fetchTrabajos();
  }, []);
  return (




    
  <div>
    {trabajos.map((trabajo) => (
      <div key={trabajo.idcontratacion}>
        <p>Rubro: {trabajo.rubro}</p>
        <p>Estado: {trabajo.estado}</p>
      </div>
    ))}
  </div>





  );
};
export default TrabajosContratados;
